O =16;  % 详解: 赋值：计算表达式并保存到 O
Q =5;  % 详解: 赋值：计算表达式并保存到 Q

K=O;L=2;  % 详解: 赋值：计算表达式并保存到 K
 for ii=1:2  % 详解: for 循环：迭代变量 ii 遍历 1:2
 for q=20*(ii-1)+1:20*ii  % 详解: for 循环：迭代变量 q 遍历 20*(ii-1)+1:20*ii
  a=y(q,:);  % 详解: 赋值：将 y(...) 的结果保存到 a
  [partition,codebook] = lloyds(a,2^4);  % 详解: 执行语句
  N=length(partition)+1;  % 详解: 赋值：将 length(...) 的结果保存到 N
  for i=1: length(a)  % 详解: for 循环：迭代变量 i 遍历 1: length(a)
     if a(i)>partition(N-1)  % 详解: 条件判断：if (a(i)>partition(N-1))
         c(i)=N;  % 详解: 执行语句
     else if  a(i)<=partition  % 详解: 条件判断：else 分支
           c(i)=1;  % 详解: 执行语句
         else  % 详解: 条件判断：else 分支
            for j=1:N-2  % 详解: for 循环：迭代变量 j 遍历 1:N-2
            if  partition(j)<a(i)&a(i)<=partition(j+1)  % 详解: 条件判断：if (partition(j)<a(i)&a(i)<=partition(j+1))
            c(i)=j+1;  % 详解: 执行语句
            end  % 详解: 执行语句
            end  % 详解: 执行语句
        end  % 详解: 执行语句
     end  % 详解: 执行语句
  end  % 详解: 执行语句
  d(q,:)=c;  % 详解: 执行语句
 end  % 详解: 执行语句
prior1 = normalise(rand(Q,1));  % 详解: 赋值：将 normalise(...) 的结果保存到 prior1
transmat1 = mk_stochastic(rand(Q,Q));  % 详解: 赋值：将 mk_stochastic(...) 的结果保存到 transmat1
obsmat1 = mk_stochastic(rand(Q,O));  % 详解: 赋值：将 mk_stochastic(...) 的结果保存到 obsmat1

[LL, prior2(:,:,ii), transmat2(:,:,ii), obsmat2(:,:,ii)] = dhmm_em(d((20*(ii-1)+1:20*ii),:), prior1, transmat1, obsmat1, 'max_iter', 100);  % 详解: 执行语句
figure(1);  % 详解: 调用函数：figure(1)
plot(LL);  % 详解: 调用函数：plot(LL)
hold on  % 详解: 执行语句
end  % 详解: 执行语句
   

